@razbreeze that's literally the words from Logitech's press release. "Solid" is MUCH worse than "Strong" and "Double-Digit Sales growth" or "Strongest growth in last 5 years" which is what their last reports have said.

A company that deserves to continue trading at all-time-highs does not say "solid" and quote macroeconomic challenges.

sorry, but it will be a tough day for $LOGI tomorrow. I'm not a perma-bear or anything, I just bought 10 x $40 puts because it's hard to continue winning as a hardware biz in their industry. Bearish

@humour good points. I don’t limit myself to cloud only stocks so I would certainly broaden if I found the right businesses to own. $VEEV and $ILMN are two examples of businesses I’m considering.

One note though, I really don’t think these companies will always trade as one “sector” because they all do different things. Eventually most companies will be “cloud stocks” because that’s where the world is moving. Then they’ll be treated as individual businesses IMO.

Either way, I don’t care if they go up or down as s wrongly grouped sector in the short term. I care about how their businesses look because that’s what matters over many years.

